description:
Senior Skip Day (2008)  

Verenigde Staten
Komedie
92 minuten

geregisseerd door Nick Weiss
met Larry Miller, Tara Reid en Lea Thompson

Een aantal scholieren heeft het plan opgevat om op een bepaalde dag allemaal te gaan spijbelen. Maar door een loslippige scholier komt de schooldirecteur achter het plan. Nu moeten de leerlingen uitwijken naar een plaats waar de directeur hen nooit zal verwachten. Daarom besluiten zij om in zijn woning in te breken en zijn huis te gebruiken voor hun party.


